import React, {useEffect, useState} from "react"
import axios from "axios"

import {useNavigate, Link} from "react-router-dom"

function Signup() {
    const[email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    const [firstname, setFirstName] = useState('')
    const [lastname , setLastName] = useState('')

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
          const response = await axios.post(
            "http://localhost:5555/signup", // Updated URL to match your API route
            {
              firstname: firstname,
              lastname: lastname,
              email: email,
              password: password
            },
            {
              headers: {
                "Content-Type": "application/json"
              },
              withCredentials: true, // Include credentials if necessary
            }
          );
          console.log(response.data); // Handle successful response
        } catch (error) {
          console.error(error); // Handle error
        }
    };
    return(
        <div className = "login">
            <h1>Sign up</h1>
            <form onSubmit={handleSubmit}>
                <input type = "email" onChange={(e) => {setEmail(e.target.value)}} placeholder="email"/>
                <input type = "password" onChange={(e) => {setEmail(e.target.value)}} placeholder="password"/>
                <input type = "firstname" onChange={(e) => {setFirstName(e.target.value)}} placeholder="firstname"/>
                <input type = "lastname" onChange={(e) => {setLastName(e.target.value)}} placeholder="lastname"/>
                <input type = "submit" value = "Sign Up"/>
            </form>


            <Link to="/signup">Signup Page</Link>
        </div>
    )
}
export default Signup
